/******/ (() => { // webpackBootstrap
/******/ 	"use strict";
/*!********************!*\
  !*** ./js/main.ts ***!
  \********************/

// Création de deux étudiants
var student1 = {
    firstName: 'Alice',
    lastName: 'Merveille',
    age: 22,
    location: 'Paris',
};
var student2 = {
    firstName: 'Bob',
    lastName: 'Dylan',
    age: 25,
    location: 'Lyon',
};
// Liste des étudiants
var studentsList = [student1, student2];
// Création tableau HTML
var table = document.createElement('table');
table.style.borderCollapse = 'collapse';
table.style.width = '50%';
table.style.margin = '20px auto';
table.style.border = '1px solid black';
// Création de en tête du tableau
var headerRow = document.createElement('tr');
var header1 = document.createElement('th');
header1.textContent = 'First Name';
var header2 = document.createElement('th');
header2.textContent = 'Location';
[header1, header2].forEach(function (header) {
    header.style.border = '1px solid black';
    header.style.padding = '8px';
    headerRow.appendChild(header);
});
table.appendChild(headerRow);
// Ajout des lignes du tableau
studentsList.forEach(function (student) {
    var row = document.createElement('tr');
    var firstNameCell = document.createElement('td');
    firstNameCell.textContent = student.firstName;
    var locationCell = document.createElement('td');
    locationCell.textContent = student.location;
    [firstNameCell, locationCell].forEach(function (cell) {
        cell.style.border = '1px solid black';
        cell.style.padding = '8px';
        row.appendChild(cell);
    });
    table.appendChild(row);
});
// Ajout du tableau à la page
document.body.appendChild(table);

/******/ })()
;
